import React from "react";
import "../css_styles/DetailCategory.css";
import { Link } from "react-router-dom";
import {
  Grid,
  Paper,
  Typography,
  Avatar,
  TextField,
  Button,
} from "@mui/material";

const DetailCategory = () => {
  return (
    <Grid className="detailCategory" container>
      <Grid item className="detailCategoryItem" md={3} lg={3} sm={6} xs={6}>
        <Link className="text-link" to={`/advertise-detail/`}>
          <Grid className="gridImage">
            <img src={require("../images/flowers.png").default} />
            <h3>Restaurant</h3>
          </Grid>
        </Link>
      </Grid>


      <Grid item className="detailCategoryItem" md={3} lg={3} sm={6} xs={6}>
        <Link className="text-link" to={`/advertise-detail/`}>
          <Grid className="gridImage">
            <img src={require("../images/flowers.png").default} />
            <h3>Restaurant</h3>
          </Grid>
        </Link>
      </Grid>
    </Grid>
  );
};

export default DetailCategory;
